import React from "react";
import {Container, Row, Col} from "react-bootstrap";

const IntroComp = () => {
return (
    <div>
        <Container>
            <Row>
                <Col>
                    <div></div>
                </Col>
            </Row>
        </Container>
    </div>
);

};



export default IntroComp;
